parts:
{
  "name": "UBX-NAV-SBAS",
  "class_id": "0x01",
  "message_id": "0x32",
  "message_type": "periodic_polled",
  "comment": "This message outputs the status of the SBAS sub system",
  "payload_length": {
    "variable": {
      "base": 12,
      "formula": "12 + cnt * 12"
    }
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "iTOW",
      "data_type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 4,
      "name": "geo",
      "data_type": "U1",
      "description": "PRN Number of the GEO where correction and integrity data is used from"
    },
    {
      "byte_offset": 5,
      "name": "mode",
      "data_type": "U1",
      "description": "SBAS Mode",
      "values": {
        "0": "Disabled",
        "1": "Enabled integrity",
        "3": "Enabled test mode"
      }
    },
    {
      "byte_offset": 6,
      "name": "sys",
      "data_type": "I1",
      "description": "SBAS System (WAAS/EGNOS/...)",
      "values": {
        "-1": "Unknown",
        "0": "WAAS",
        "1": "EGNOS",
        "2": "MSAS",
        "3": "GAGAN",
        "16": "GPS"
      }
    },
    {
      "byte_offset": 7,
      "name": "service",
      "data_type": "X1",
      "description": "SBAS Services available",
      "bitfields": [
        {
          "name": "Ranging",
          "bits": 1,
          "byte_offset": 0,
          "description": "GEO may be used as ranging source"
        },
        {
          "name": "Corrections",
          "bits": 1,
          "byte_offset": 0,
          "bit_offset": 1,
          "description": "GEO is providing correction data"
        },
        {
          "name": "Integrity",
          "bits": 1,
          "byte_offset": 0,
          "bit_offset": 2,
          "description": "GEO is providing integrity"
        },
        {
          "name": "Testmode",
          "bits": 1,
          "byte_offset": 0,
          "bit_offset": 3,
          "description": "GEO is in test mode"
        },
        {
          "name": "Bad",
          "bits": 1,
          "byte_offset": 0,
          "bit_offset": 4,
          "description": "Problem with signal or broadcast data indicated"
        }
      ]
    },
    {
      "byte_offset": 8,
      "name": "cnt",
      "data_type": "U1",
      "description": "Number of SV data following"
    },
    {
      "byte_offset": 9,
      "name": "statusFlags",
      "data_type": "X1",
      "description": "SBAS status flags",
      "bitfields": [
        {
          "name": "integrityUsed",
          "bits": 2,
          "byte_offset": 0,
          "bit_offset": 0,
          "description": "SBAS integrity used",
          "values": {
            "0": "Unknown",
            "1": "Integrity information is not available or SBAS integrity is not enabled",
            "2": "Receiver uses only GPS satellites for which integrity information is available"
          }
        }
      ]
    },
    {
      "byte_offset": 10,
      "name": "reserved0",
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "reserved": true,
      "description": "Reserved"
    },
    {
      "byte_offset": 12,
      "name": "repeated_group",
      "data_type": {
        "array_of": {
          "element_length": 12,
          "fields": [
            {
              "byte_offset": 0,
              "name": "svid",
              "data_type": "U1",
              "description": "SV ID"
            },
            {
              "byte_offset": 1,
              "name": "reserved1",
              "data_type": "U1",
              "reserved": true,
              "description": "Reserved"
            },
            {
              "byte_offset": 2,
              "name": "udre",
              "data_type": "U1",
              "description": "Monitoring status"
            },
            {
              "byte_offset": 3,
              "name": "svSys",
              "data_type": "U1",
              "description": "System (WAAS/EGNOS/...) same as SYS"
            },
            {
              "byte_offset": 4,
              "name": "svService",
              "data_type": "U1",
              "description": "Services available same as SERVICE"
            },
            {
              "byte_offset": 5,
              "name": "reserved2",
              "data_type": "U1",
              "reserved": true,
              "description": "Reserved"
            },
            {
              "byte_offset": 6,
              "name": "prc",
              "data_type": "I2",
              "unit": "cm",
              "description": "Pseudo Range correction in [cm]"
            },
            {
              "byte_offset": 8,
              "name": "reserved3",
              "data_type": {
                "array_of": "U1",
                "count": 2
              },
              "reserved": true,
              "description": "Reserved"
            },
            {
              "byte_offset": 10,
              "name": "ic",
              "data_type": "I2",
              "unit": "cm",
              "description": "Ionosphere correction in [cm]"
            }
          ]
        },
        "count_field": "cnt"
      }
    }
  ]
}
